import React from "react";
import styled from "styled-components";

const Body = ({ children }) => {
  return <Container>{children}</Container>;
};

const Container = styled.div`
  display: grid;
  gap: calc(${({ theme }) => theme.gap} / 2);
`;

export default Body;
